import { StyleSheet, Text, View } from 'react-native'
import React from 'react'

export default function Infos(props) {
  return (
    <View>
      <Text style={styles.name} >{props.name} {props.surname}</Text>
    </View>
  )
}

const styles = StyleSheet.create({
    name: {
        fontSize: 20,
        fontWeight: 'bold',
    },
})
